import { useEffect, useState } from "react"

export default function ParkingList() {
    const [currentTime, setCurrentTime] = useState(0)
    const [availableParkingCarType, setAvailableParkingCarType] = useState([])
    let availableParkingId = [], availableParkingCarTypeVar = []
    let fetched = []
    const [parkingList, setParkingList] = useState([])
    let carType = []
    const endPoint = "https://api.data.gov.hk/v1/carpark-info-vacancy"
    const load = () => {
        const parkingListVar = []
        fetch(endPoint + "?data=vacancy")
            .then(response => response.json())
            .then(fetchedResult => {
                fetched = fetchedResult.results;
                fetched.map((parking => {

                    if (parking.privateCar !== undefined && parking.privateCar[0].vacancy > 0) {
                        carType.push("Private Car, ")
                    }
                    if (parking.LGV !== undefined && parking.LGV[0].vacancy > 0) {
                        carType.push("Light Goods Vehicle, ")
                    }
                    if (parking.HGV !== undefined && parking.HGV[0].vacancy > 0) {
                        carType.push("Heavy Goods Vehicle, ")
                    }
                    if (parking.CV !== undefined && parking.CV[0].vacancy > 0) {
                        carType.push("Container Vehicle, ")
                    }
                    if (parking.coach !== undefined && parking.coach[0].vacancy > 0) {
                        carType.push("Coach, ")
                    }
                    if (parking.motorCycle !== undefined && parking.motorCycle[0].vacancy > 0) {
                        carType.push("Motor Cycle, ")
                    }
                    if (carType.length > 0) {
                        availableParkingId.push(parking.park_Id);
                        availableParkingCarTypeVar.push(carType)
                    }
                }))
                console.log(carType)
                fetch(endPoint)
                    .then(response => response.json())
                    .then(fetchedResult => {fetchedResult.results.filter((parking) => {
                        availableParkingId.includes(parking.park_Id) && parkingListVar.push(parking);
                        setAvailableParkingCarType(availableParkingCarType => availableParkingCarTypeVar)

                    })
                    setParkingList(parkingListVar)
                })
            })
    }
}
